CREATE SCHEMA ods;

create table ods.cooperativa
(
    cd_coop                 integer        not null
        primary key,
    cd_cidade               integer        not null,
    sigla                   varchar(30)    not null,
    nm_coop                 varchar(80)    not null,
    ds_endereco             varchar(60),
    cep                     varchar(9),
    sc_bairro               varchar(20),
    cgc                     varchar(14)    not null,
    dt_cgc                  timestamp,
    dt_constituicao         timestamp,
    nr_registro             numeric(12),
    dt_registro             timestamp,
    nr_carta                numeric(12),
    dt_carta                timestamp,
    qt_min_cotas            numeric(7, 2)  not null,
    vl_cota                 numeric(14, 2) not null,
    cd_matr_presidente      numeric(10),
    cd_matr_vice            numeric(10),
    cd_matr_dir             numeric(10),
    cd_matr_gerente         numeric(10),
    cd_matr_resp            numeric(10),
    nr_crc_resp             varchar(30),
    id_tipo_coop            char           not null
        constraint ckc_id_tipo_coop
        check (id_tipo_coop = ANY (ARRAY ['C' :: bpchar, 'F' :: bpchar])),
    nr_fone                 varchar(10),
    nr_ddd                  varchar(4),
    nr_fax                  varchar(10),
    nr_email                varchar(60),
    nr_fone_2               varchar(10),
    nr_sirc                 integer,
    dt_alteracao            timestamp,
    cd_usuario_alt          varchar(10)    not null,
    dt_inclusao             timestamp      not null,
    cd_matr_dirfin          numeric(10),
    dir_arq_unicrednet      varchar(80),
    qt_dias_unicrednet      numeric(4),
    id_liq_diario           char,
    hr_limite               timestamp,
    vl_lim_trans_unicrednet numeric(14, 2),
    nm_responsavel          varchar(60),
    cpf_resp                varchar(11),
    nm_presidente           varchar(60),
    cpf_presidente          varchar(11),
    nm_vice                 varchar(60),
    cpf_vice                varchar(11),
    nm_diretor              varchar(60),
    cpf_diretor             varchar(11),
    nm_gerente              varchar(60),
    cpf_gerente             varchar(11),
    nm_dirfin               varchar(60),
    cpf_dirfin              varchar(11),
    id_tipo_resp            char,
    id_fundo_garantidor     char,
    cd_credis               varchar(6),
    cd_central              integer,
    nr_fone_ouvidoria       varchar(14),
    cd_natureza_juridica    integer,
    cd_cnae_fiscal          numeric(7),
    ds_coop_junta_com       varchar(255)   not null,
    nr_prox_pessoa          integer        not null,
    nr_prox_matricula       numeric(10)    not null,
    cd_cidade_ibge          numeric(7),
    inscr_municipal         varchar(15),
    ispb_cooperativa        integer,
    ispb_bacen              integer,
    cd_banco_darf           integer,
    in_singular_filiada     char,
    ds_email_ouvidoria      varchar(60),
    cnpj_central            varchar(14),
    nr_version              integer,
    cd_usuario_inc          integer,
    cd_usuario_alt_arq      integer,
    nm_cooperativa_cheque_1 varchar(35),
    nm_cooperativa_cheque_2 varchar(35),
    nm_cooperativa_cheque_3 varchar(35),
    in_importou_cidades     char,
    in_recurso_bndes        char,
    cd_agente_bndes         numeric(4),
    in_decl_proposito       char,
    ds_decl_proposito       varchar(500),
    in_recurso_brde         char,
    cd_convenio_brde        numeric(4),
    cd_cidade_caf           integer,
    cd_matr_super           numeric(10),
    nm_super                varchar(60),
    cpf_super               varchar(11),
    cd_area                 integer        not null,
    cd_coop_ubr             integer,
    in_compe_separada       char,
    cd_uf_crc               varchar(2),
    nr_ano_crc              integer,
    dt_validade_crc         timestamp,
    ods_dh                  timestamp,
    ods_ope                 char,
    flg_ativo               varchar(1) default 'S' :: character varying
);

comment on table ods.cooperativa
is 'Registro Cadastral de todas as Cooperativas aptas do Sistema Unicred para identificação do cooperado, com seus respectivos dados cadastrais (endereços).';


create table if not exists ods.posto
(
	cd_coop integer not null,
	cd_posto integer not null,
	cd_cidade integer not null,
	sigla_posto varchar(30) not null,
	nm_posto varchar(80) not null,
	ds_endereco_posto varchar(60) not null,
	ds_bairro varchar(20),
	cep_posto varchar(9),
	cd_conta_gerente_posto numeric(10),
	nr_fone varchar(10),
	nr_ddd varchar(4),
	nr_fax varchar(10),
	nr_email varchar(60),
	nr_remessa integer not null,
	dt_alteracao timestamp,
	cd_usuario_alt varchar(10) not null,
	dt_inclusao timestamp not null,
	nr_prox_matricula numeric(10),
	nr_arqrem_cob integer not null,
	nr_arqrem_liqelet integer not null,
	cd_entr_dados_liq char,
	cd_conta_conv_liq numeric(10),
	nr_prox_pessoa integer,
	nr_prox_cedente numeric(5),
	nr_prox_titulo numeric(4),
	cd_agencia_convenio varchar(6),
	cd_conta_convenio varchar(13),
	id_ult_banco_liq_tit numeric(6),
	cd_gera_protocolo char,
	nr_contrato_pag numeric(8),
	cd_convenio_custodia varchar(20),
	cd_agencia_rec varchar(6),
	cd_compe integer,
	cgc varchar(14),
	cd_ag_corr_banc numeric(4),
	cd_conta_caixa varchar(10),
	nr_caixa_corr_banc integer,
	cd_tp_lcto_compe numeric(6),
	cd_cta_ctb_vlr_prop_cust varchar(10),
	cd_cta_ctb_vlr_terc_cust varchar(10),
	cd_tp_lcto_chq_dev numeric(6),
	cd_tp_lcto_chq_tb numeric(6),
	nr_prox_conta numeric(10),
	nr_conta_ini numeric(10),
	nr_conta_fim numeric(10),
	vl_saldo_atual_posto numeric(14,2),
	cd_tp_posto numeric(1) not null,
	nr_version integer,
	cd_usuario_inc integer,
	cd_usuario_alt_arq integer,
	hr_limite_dep_chq timestamp,
	cd_tp_lcto_compe_spb numeric(6),
	cd_tp_lcto_chq_tb_spb numeric(6),
	cd_tp_lcto_chq_dev_spb numeric(6),
	cd_conta_convenio_bansicredi numeric(10),
	nr_loja_coban integer,
	cd_tp_lcto_compe_spb_ubr numeric(6),
	cd_tp_lcto_chq_tb_spb_ubr numeric(6),
	inscr_municipal varchar(15),
	cd_tp_lcto_chq_dev_spb_ubr numeric(6),
	ds_posto varchar(100),
	subst_coban numeric(4),
	in_conta_seq char default 'N'::bpchar not null
		constraint ckc_in_conta_seq
			check (in_conta_seq = ANY (ARRAY['N'::bpchar, 'S'::bpchar])),
	ods_dh timestamp,
	ods_ope char,
	flg_ativo varchar(1) default 'S'::character varying,
	constraint pk_posto
		primary key (cd_coop, cd_posto)
)
;

comment on table ods.posto is 'Registro Cadastral de todos os Postos/Agências/Ponto de Atendimentos aptos para classificar o cooperado, com seus respectivos dados cadastrais (endereços).'
;

create index if not exists posto_cidade_fk
	on ods.posto (cd_cidade)
;








